import Info from "./Info";
import {Link} from 'react-router-dom';
import './Icon.css'

function Icon(){
return(

<div class="container">
    <Link to="">
        <li  >
                <h2>icon</h2>
        </li>
    </Link>

    <Link to="" className="btn btn-2">
       
            {/* <i className="fa fa-chevron-up"></i> */}
            <h2>abt</h2>
     
    </Link>

    <Link to=""  className="btn btn-3">
        
    {/* <i className="fa fa-music"></i> */}
        <h2>blg</h2>
    
    </Link>

    <Link to="" className="btn btn-4" >
       
        {/* <i className="fa fa-globe"></i> */}
        <h2>cnt</h2>
     
    </Link>

    <Link  to="info" className="btn btn-5">
        
            <h2>info</h2>
     
    </Link>
</div>
)
}

export default Icon
